const Contact = () => {
    return (
        <>
            <div className="contact-container">
                <h1>Contact</h1>
                <form action="">
                    <label htmlFor="">
                        Name:
                    </label>
                    <input type="text" placeholder="Enter Your Name" />
                </form>
            </div>
        </>
    );
}

export default Contact;
